import React, { Component } from "react";

class Button extends Component {
  render() {
    return (
      <div style={this.props.disabled ? style.disabledButton : style.button}>
        {this.props.text}
      </div>
    );
  }
}

const style = {
  button: {
    backgroundColor: "#00A88C",
    width: "175px",
    height: "45px",
    borderRadius: "45px",
    textAlign: "center",
    verticalAlign: "middle",
    lineHeight: "45px",
    fontSize: "15px",
    boxShadow: "0px 5px 20px rgba(0, 0, 0, 0.5)",
    userSelect: "none",
    cursor: "pointer"
  },
  disabledButton: {
    backgroundColor: "grey",
    width: "175px",
    height: "45px",
    borderRadius: "45px",
    textAlign: "center",
    verticalAlign: "middle",
    lineHeight: "45px",
    fontSize: "15px",
    boxShadow: "0px 5px 20px rgba(0, 0, 0, 0.5)",
    userSelect: "none"
  }
};

export default Button;
